
public class StringToChar {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		//Convert String to char array
		
		String str="Good";
		char[] ch=str.toCharArray();
		for(int i=0;i<ch.length;i++) {
			System.out.println(ch[i]);
			System.out.println(" ");
		}
	}

}
